def find_matching_pairs(N, a, b):

    def compute_prefix_function(s):
        w = [0] * N
        for i in range(1, N):
            j = w[i - 1]
            while j != 0 and s[i] != s[j]:
                j = w[j - 1]
            if s[i] == s[j]:
                w[i] = j + 1
            else:
                w[i] = 0
        return w
    s = [a[i] ^ a[(i + 1) % N] for i in range(N)]
    t = [b[i] ^ b[(i + 1) % N] for i in range(N)] / 2
    w = compute_prefix_function(s)
    k_list = []
    (i, j) = (0, 0)
    while i < N:
        while j < N and t[i + j] == s[j]:
            j += 1
        if j == N:
            k_list.append(-i % N)
        if j == 0:
            i += 1
        else:
            i += j - w[j - 1]
            j = w[j - 1]
    k_list.sort()
    result = []
    for k in k_list:
        x = a[k] ^ b[0]
        result.append((k, x))
    return result

